import React, { Component } from 'react'

const classes = {
    returnArrow: {
        fontSize: '40px',
        position: 'absolute',
        marginTop: '40%'
    }
}

class LprConfig extends Component{
    render(){
        return(
            <div>
                <h1>Hello</h1>
                <a href="/dashboard/configuration">
                    <span class="material-icons" style={classes.returnArrow}>
                        arrow_back_ios
                    </span>  
                </a>           
            </div>
        )
    }

}

export default LprConfig
